export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:d,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:d,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:d,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},CbOma8pkvF:{data:{id:812,attributes:{imdbId:"tt1698647",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZTkzNWVlYWEtNzZkNC00OWEyLTgwYjYtNjUwZDY5MWNjM2U0XkEyXkFqcGdeQXVyMzU5NjU1MDA@._V1_SX300.jpg",type:d,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"}],item_lang:{data:{id:1475,attributes:{title:h,plot:"In this dystopian society love is a disease. Once some one is 18 they are allowed to get the cure. Lena has always dreamed about the perfect life. Her evaluation and then cure is coming up. Will she get the cure, or will someone get in the way.",slug:"delirium"}}},books:{data:[{id:5064,attributes:{title:h,description:"Lauren Oliver's powerful New York Times bestselling novel Delirium—the first in a dystopian trilogy—presents a world as terrifying as George Orwell's 1984 and a romance as true as Romeo & Juliet. In an alternate United States, love has been declared a dangerous disease, and the government forces everyone who reaches eighteen to have a procedure called the Cure. Living with her aunt, uncle, and cousins in Portland, Maine, Lena Haloway is very much looking forward to being cured and living a safe, predictable life. She watched love destroy her mother and isn't about to make the same mistakes. But with ninety-five days left until her treatment, Lena meets enigmatic Alex, a boy from the Wilds who lives under the government's radar. What will happen if they do the unthinkable and fall in love? Delirium received starred reviews from Kirkus and School Library Journal, and was named a Best Book of the Year by USA Today, Kirkus, Amazon.com, YALSA, and the Chicago Public Library and was selected as one of NPR's Top 100 Best Ever Teen Novels. Supports the Common Core State Standards",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sSJ-uQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2012-07-03",publisher:b,subtitle:c}},{id:5065,attributes:{title:"Requiem",description:"A New York Times, USA Today, and Publishers Weekly bestseller, this exciting finale to Lauren Oliver's acclaimed Delirium trilogy is a riveting blend of nonstop action and forbidden romance in a dystopian United States. With lyrical writing, Lauren Oliver seamlessly interweaves the peril that Lena faces with the inner tumult she experiences after the reappearance of her first love, Alex, the boy she thought was dead. Named an Amazon Best Book of the Year, this sophisticated and wide-ranging novel brings the New York Times bestselling Delirium trilogy to a thrilling conclusion. Now an active member of the resistance, Lena has transformed. The nascent rebellion that was underway in Pandemonium has ignited into an all-out revolution in Requiem, and Lena is at the center of the fight. After rescuing Julian from a death sentence, Lena and her friends fled to the Wilds. But the Wilds are no longer a safe haven. Pockets of rebellion have opened throughout the country, and the government cannot deny the existence of Invalids. Regulators infiltrate the borderlands to stamp out the rebels. As Lena navigates the increasingly dangerous terrain of the Wilds, her best friend, Hana, lives a safe, loveless life in Portland as the fiancée of the young mayor. Requiem is told from both Lena and Hana's points of view. They live side by side in a world that divides them until, at last, their stories converge.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jFdwnQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2014-02-04",publisher:b,subtitle:c}},{id:5066,attributes:{title:"Pandemonium",description:"The old life is dead. But the old Lena is dead too. I buried her. I left her beyond a fence, behind a wall of smoke and ﬂame. In this electrifying follow-up to her acclaimed New York Times bestseller Delirium, Lauren Oliver sets Lena on a dangerous course that hurtles through the unregulated Wilds and into the heart of a growing resistance movement. This riveting, brilliant novel crackles with the fire of fierce defiance, forbidden romance, and the sparks of a revolution about to ignite.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VIkiLwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2013-01-22",publisher:b,subtitle:c}},{id:5067,attributes:{title:"Delirium Stories: Hana, Annabel, Raven, and Alex",description:"The short-story collection companion to Lauren Oliver’s New York Times bestselling trilogy about forbidden love, revolution, and the power to choose. Now with a brand-new cover and an exclusive-to-this-book sneak peek at her next novel for teens: the ambitious, wholly original masterwork Replica. Lauren Oliver’s short stories about Hana, Annabel, Raven, and Alex expand and enrich the Delirium world, illuminating events and characters through new perspectives. Hana adds nuance to the life-changing summer before best friends Lena and Hana are to be cured—a moment when the girls’ paths diverge and their futures are altered forever. Annabel untangles the mysteries surrounding Lena’s mother, detailing her journey from teenage runaway to prisoner of the state. Raven crackles with the intensity of its title character, the fierce leader of a rebel group in the Wilds who plays an integral role in the resistance. And Alex explains what happened to Lena’s first love after the events of Delirium, as well as the dark past that he has tried to forget.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8GVGjwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2016-05-17",publisher:b,subtitle:c}},{id:5068,attributes:{title:"Delirium Stories: Hana, Annabel, and Raven",description:"For the first time, Lauren Oliver's short stories about characters in the Delirium world appear in print. Originally published as digital novellas, Hana, Annabel, and Raven each center around a fascinating and complex character who adds important information to the series and gives it greater depth. This collection also includes an excerpt from Requiem, the final novel in Oliver's New York Times bestselling series. Hana is told through the perspective of Lena's best friend, Hana Tate. Set during the tumultuous summer before Lena and Hana are supposed to be cured, this story is a poignant and revealing look at a moment when the girls' paths diverge and their futures are altered forever. Lena's mother, Annabel, has always been a mystery—a ghost from Lena's past—until now. Her journey from teenage runaway to prisoner of the state is a taut, gripping narrative that expands the Delirium world and illuminates events—and Lena—through a new point of view. And as the passionate, fierce leader of a rebel group in the Wilds, Raven plays an integral role in the resistance effort and comes into Lena's life at a crucial time. Crackling with intensity, Raven is a brilliant story told in the voice of one of the strongest and most tenacious characters in the Delirium world.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JQnNMgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"2013-03-05",publisher:b,subtitle:c}}]}}},meta:{}}},prerenderedAt:1682568436066}}("Lauren Oliver","HarperCollins","","movie",null,"series",1,"Delirium"))